package other

import (
	"fmt"
	"math"
	"sort"
	"testing"
)

func TestMaxSumRangeQuery(t *testing.T) {

	fmt.Println(2 ^ 31 - 1)
	fmt.Println(math.Pow(2, 31) - 1)
	fmt.Println(math.Pow(-2, 31))
}

func MaxSumRangeQuery(nums []int, requests [][]int) int {
	sort.Ints(nums)
	nl := len(nums)

	m := map[int]int{}
	for _, request := range requests {
		for i := request[0]; i <= request[1]; i++ {
			m[i] = m[i] + 1
		}
	}
	fmt.Println(m)

	var countArr []int
	for _, v := range m {
		countArr = append(countArr, v)
	}
	sort.Ints(countArr)

	cl := len(countArr)
	ans := 0
	idx := nl - 1
	for i := cl - 1; i >= 0; i-- {
		ans += nums[idx] * countArr[i]
		idx--
	}
	ans %= 1000000007
	return ans
	//return ans
}

