func MinSubarray(nums []int, p int) int {

	nl, sum := len(nums), 0
	for i := 0; i < nl; i++ {
		sum += nums[i]
	}

	if sum%p == 0 {
		return 0
	}
	if sum < p {
		return -1
	}

	minVal := math.MaxInt32
	for i := 0; i < nl; i++ {
		ns := sum
		for j := i; j < nl; j++ {
			ns -= nums[j]
			if ns%p == 0 {
				minVal = min(minVal, j-i+1)
				break
			}
		}
	}
	if minVal == math.MaxInt32 || minVal == nl {
		return -1
	}
	return minVal
}

func TestReverse(t *testing.T) {

	fmt.Println(Reverse(-987654))

}
func Reverse(x int) int {

	ans := 0
	for x != 0 {
		tmp := x % 10
		ans = ans*10 + tmp
		x /= 10
	}
	if ans > 2147483648 || ans < -2147483648 {
		return 0
	}
	return ans
}
